package Lec1;

public class Odd_Even {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n = 671;
		if (n > 781) {
			System.out.println("yes");
		}else {
			System.out.println("No");
		}
		
		if (n % 2 == 0) {
			System.out.println("Even");
		} 
		else {
			System.out.println("odd");
		}

	}

}
